import React from "react"
import {
  BrowserRouter,
  Routes,
  Route,
  Link
} from 'react-router-dom';import Home from '../index';
import Toys from './Toys';
import ForKids from './ForKids';
import AboutUs from './AboutUs';
import Gift from './Gift';
import Blog from './Blog';

class Header extends React.Component {
  render() {
    return (
      <Router>
        <nav>
          <ul>
            <li><Link to="/index">Главное</Link></li>
            <li><Link to="/Toys">Игрушки</Link></li>
            <li><Link to="/ForKids">Для детей</Link></li>
            <li><Link to="/AboutUs">О нас</Link></li>
            <li><Link to="/Gift">Подарки</Link></li>
            <li><Link to="/Blog">Блог</Link></li>
          </ul>
        </nav>


        <Routes>
          <Route exact path="/" component={index} />
          <Route path="/Toys" component={Toys} />
          <Route path="/ForKids" component={ForKids} />
          <Route path="/AboutUs" component={AboutUs} />
          <Route path="/Gift" component={Gift} />
          <Route path="/Blog" component={Blog} />
        </Routes>
      </Router>
    );
  }
}

export default Header
